import React from 'react'

const JobCard = () => {
    return (
        <div className="job-card">
            <div className="company-logo">
                LOGO
            </div>
            <div className="company-info">
                <p className="company-date">5 h ago</p>
                <p className="company-time">Full Time</p>
            </div>
        </div>
    )
}

export default JobCard;
